import Link from "next/link";
import NavCss from "../style/NavCss";
import Icon from '../component/Icon'
import {useRouter} from "next/router";

export default function Nav() {
    const router = useRouter();
    return (
        <NavCss className="Nav">
            <Link href="/" className={router.pathname === "/" ? "active" : ""}><a><Icon iconClass="wait"/>代办</a></Link>
            <Link href="/about" className={router.pathname === "/about" ? "active" : ""}><a><Icon iconClass="document"/>待办板</a></Link>
            <Link href="/blank" className={router.pathname === "/blank" ? "active" : ""}><a><Icon iconClass="stc"/>数据统计</a></Link>
            <Link href="/my" className={router.pathname === "/my" ? "active" : ""}><a><Icon
                iconClass="my"/>我的</a></Link>
        </NavCss>
    )
}
